  [],\n\t\"revision_timestamp\": \"2013-03-15T09:25:48.369972\",\n\t\"name\": \"spatial-vegetation-data-for-dinosaur-national-monument-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This polygon feature class represents vegetation
  communities mapped at Dinosaur National Monument. The polygons were delineated following
  guidelines set by the National Vegetation Classification System (October 1995).
  Original lines were drawn on a mylar overlay on top of printed 1:12,000 digital
  scale orthophoto quadrangles (DOQ), collected in the summer of 2002. Hard copy 9X9
  stereo aerial photography was used for photo interpretation. Intuitive ecological
  modeling and visual interpretation cues, such as shape, size, pattern, tone, texture,
  color, and shadow, were used to develop the polygons. Additional data layers used
  to aid the interpretation include slope, hydrology, geography, and ground-collected
  vegetation information. The lines developed in the image interpretation step were
  scanned using a large format scanner. The resultant scanned raster image was converted
  into a vector coverage to facilitate editing the linework within ArcGIS. The line
  work was cleaned, polygons created and attributed. The attributed vegetation classes
  were subjected to an accuracy assessment, following which final adjustments were
  made to the vegetation classes. As with any digital layer, this layer is a representation
  of what is actually occurring on the ground. Errors are inherent in any interpretation
  of ground qualities. Due to the \"snapshot\" nature of the DOQs, this vegetation
  layer reflects conditions that existed when the imagery was collected.\",\n\t\"license_title\":
